content.css:
p {
  font-size: 20px;
  font-weight: bold;
}
p em {
  background: yellow;
  padding: 5px;
}
.axis path,
.axis line,
.tooltipLine,
.rightLine,
.leftLine,
.topLine,
.bottomLine,
.groupLine {
  fill: none;
  stroke: #a8a8a8;
  shape-rendering: crispEdges;
}
.yAxis .domain {
  stroke: none;
}
.barChart {
  font-family: 'Segoe UI', 'wf_segoe-ui_normal', helvetica, verdana, arial, sans-serif;
}
.axis {
  font-size: 10px;
}
.tooltip {
  display: block;
  position: absolute;
  font-size: 12px;
  padding-top: 5px;
  padding-left: 10px;
}
.legend {
  display: block;
  position: absolute;
  font-size: 12px;
  padding-top: 2px;
}
/*
.barContainer .trial
{
    fill: red;
}
*/
.instruction,
.infoMessage {
  display: none;
  position: absolute;
  font-size: 14px;
  width: 100%;
  height: 100%;
  left: 0px;
  top: 0px;
  padding: 10px;
  background-color: white;
}
.instruction li {
  font-size: 14px;
}
.instruction H2 {
  margin-top: 5px;
  margin-bottom: 10px;
  padding: 0px;
}
.instruction .exampleImg {
  width: 900px;
  height: 425px;
  background-image: url(data:image/jpeg;base64,);
}
.instruction .adwiseLogo {
  float: right;
  margin-right: 20px;
  background-image: url(data:image/png;base64,);
  background-position: left;
  background-size: auto;
  background-repeat: no-repeat;
  width: 162px;
  height: 162px;
}
.infoMessage {
  background-color: #dcdcdc;
  padding: 0;
}
.infoMessage .messageBox {
  text-align: center;
  top: 30%;
  position: relative;
  background-image: url(data:image/png;base64,);
  background-position: center 20px;
  background-size: 50px;
  background-repeat: no-repeat;
  background-color: white;
  border-radius: 10px;
  height: 150px;
  margin: 10px;
}
.infoMessage .message {
  line-height: 20px;
  display: inline-block;
  padding: 20px;
  position: relative;
  top: 70px;
}
.instruction .adwiseLogo.enterprise {
  background-image: url(data:image/png;base64,);
}
.tooltipBackground {
  background-repeat: no-repeat;
}
.licenceButton {
  position: absolute;
  font-size: 12px;
  left: 5px;
  top: 0px;
  color: white;
  background-color: #177C6E;
  border: 1px solid gray;
  display: none;
}
.licenceButton.licensed {
  position: absolute;
  font-size: 12px;
  left: 5px;
  top: 0px;
  color: transparent;
  background-color: transparent;
  border: 1px transparent;
}
.licenceButton.licensed:hover {
  position: absolute;
  font-size: 12px;
  left: 5px;
  top: 0px;
  color: white;
  background-color: #177C6E;
  border: 1px solid gray;
}
.curtain {
  position: absolute;
  left: 0px;
  top: 0px;
  width: 100%;
  height: 100%;
  display: block;
  background: rgba(0, 0, 0, 0.6);
}
.popupWindow {
  position: absolute;
  left: 50%;
  top: 50%;
  width: 720px;
  height: 410px;
  margin-top: -250px;
  margin-left: -360px;
  display: block;
  background: white;
  border: 1px solid gray;
  border-radius: 5px;
  box-shadow: rgba(0, 0, 0, 0.3) 0 0 10px;
  padding: 20px;
}
.popupWindow H1 {
  border-bottom: 1px solid gray;
}
.popupWindow .button {
  width: 150px;
  height: 33px;
  color: white;
  background-color: #177C6E;
  border-radius: 3px;
  border: 0;
  box-shadow: rgba(0, 0, 0, 0.3) 0 0 3px;
  font-size: 14px;
  margin-top: 10px;
}
.popupWindow .button.help {
  background-color: #323232;
  position: absolute;
  bottom: 20px;
  left: 20px;
}
.popupWindow .closeBtn {
  width: 33px;
  border-radius: 16px;
  font-weight: bold;
  font-size: 11px;
  position: absolute;
  top: 10px;
  right: 20px;
  background-color: gray;
}
.popupWindow .title {
  margin-top: 0px;
}
.popupWindow .licKey {
  width: 700px;
  font-size: 11px;
  padding: 5px;
}
.popupWindow .label {
  font-weight: bold;
  margin-top: 10px;
}
.popupWindow .logo {
  position: absolute;
  right: 20px;
  bottom: 20px;
  background-image: url(data:image/png;base64,);
  background-position: left;
  background-size: contain;
  background-repeat: no-repeat;
  width: 120px;
  height: 120px;
}
.popupWindow .logo.enterprise {
  background-image: url(data:image/png;base64,);
}
table td .strong {
  font-weight: 700;
}
.scrollable {
  overflow: auto;
  scroll-behavior: smooth;
  scrollbar-width: thin;
}
.scrollable::-webkit-scrollbar {
  width: 12px;
  height: 12px;
  /* width of the entire scrollbar */
}
.scrollable::-webkit-scrollbar-track {
  background: #F0F0F0;
  /* color of the tracking area */
}
.scrollable::-webkit-scrollbar-thumb {
  background-color: #CDCDCD;
  /* color of the scroll thumb */
  border: 1px solid #F0F0F0;
  /* creates padding around scroll thumb */
}
.chartContentWrapper,
.leftAxisWrapper,
.rightAxisWrapper,
.timeAxisWrapper,
.timeAxis2Wrapper,
.timeScrollArea,
.yScrollArea {
  position: absolute;
  left: 0px;
  top: 0px;
  overflow: hidden;
  border: 0px;
}
.chartContentWrapper,
.timeAxisWrapper,
.timeAxis2Wrapper,
.timeScrollArea {
  scroll-behavior: smooth;
}
.timeScrollArea,
.yScrollArea {
  visibility: hidden;
  opacity: 1;
}
.timeScrollContent,
.yScrollContent {
  position: relative;
  left: 0px;
  top: 0px;
}
.zoomButtons .panel,
.scrollBarGroup,
.wrappingButtons .wrappingButtons {
  visibility: hidden;
  opacity: 0;
}
@keyframes show {
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}
@keyframes hide {
  0% {
    opacity: 1;
  }
  100% {
    opacity: 0;
  }
}
.scrollBar {
  stroke: rgba(255, 255, 255, 0);
  fill: rgba(255, 255, 255, 0);
}
.handler {
  fill: #CDCDCD;
}
.loaderIcon {
  background-image: url(data:image/gif;base64,);
  width: 28px;
  height: 28px;
  position: absolute;
  margin-left: auto;
  margin-right: auto;
  left: 50%;
  top: 50%;
  opacity: 0.3;
  resize: both;
  background-size: contain;
  display: none;
}
.lodaingProgressBar {
  display: none;
  width: 0px;
  height: 5px;
  background-color: #177C6E;
  position: absolute;
  left: 50%;
  top: 200px;
}
